        for (uint i = 0; i < banks.length; i++) {
            if (compareAdresses(msg.sender, banks[i].bank_address)) {
                ok = true;
            }
        }
        require(ok == true, "Sorry Only A Bank Can Pending A Request !");
        for (uint i = 0; i < vehicles.length; i++) {
